import './App.css';
import Game from './pages/Game';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import {BrowserRouter as Router, Route} from "react-router-dom";


const App = () => {
  return (
    <Router>
      <Route path="/">
        <Home />
      </Route>
      <Route path="/games">
        <Home />
      </Route>
      <Route path="/">
        <Home />
      </Route>  
    </Router>
  )
}

export default App;
